import { useState } from "react";
import Feedback from "./components/Freedback";
import Mainbody from "./components/Mainbody";

function App() {
  const [post, setpost] = useState([
    {id: 1, tittle: 'Отзыв 1', body: 'Description 1'},
    {id: 2, tittle: 'Отзыв 2', body: 'Description 2'},
    {id: 3, tittle: 'Отзыв 3', body: 'Description 3'},
  ]);

  return (
    <div>
        <div className="feedbackbody">
          <h1 className="flex justify-center text-3xl">
            Отзывы от любмых друзей
          </h1>
            {post.map(post => <div><Feedback post={post}
            key={post.id}/></div>)}
        </div>
    </div>
  );
}

export default App;
